{quote}
{{uname -s -r -v -o}}
{quote}Linux 4.4.0-59-generic #80-Ubuntu SMP Fri Jan 6 17:47:47 UTC 2017 GNU/Linux
{quote}
{{lsb_release -a}}
{quote}No LSB modules are available.
Distributor ID: Ubuntu
