I suggest this alteration to the document :

{{sudo tcpdump -i $( [ $( uname -r ) \> '2.2' ] && echo 'any' || netstat -nr | grep -E '(^[dD]efault|^0\.0\.0\.0)' | sed 's/.* //g' ) -nn src net 104.192.143.0/24 and tcp[13]=18 # determine the MSS value received from BitBucket}}

h3. Summary
Currently, if an administrator in JIRA or Confluence Cloud attempts to install an add-on but is not a site-admin, the following error is thrown:
{code}
"An unexpected error occurred"
{code}
This error is vague and causes confusion. A more appropriate error message would indicate that the user does not have the proper permissions for installing add-ons.
